import React, { Component } from 'react';
class UpLoadDocumentPage extends Component {
    state = {  }
    fileChangeHandler = (event) =>{
        console.log(event.target.files[0]);
    }
    render() { 
        return ( 
            <div className="container">
                <div className="row">
                    <div className="container col-4 bg-light">
                            <input type="file" onChange={this.fileChangeHandler} className="d-inline text-success"></input>
                    </div>
                    <div className="col-8 bg-primary">hi</div>
                </div>
            </div>
         );
    }
}
 
export default UpLoadDocumentPage;
